text199780.addInnerText('<div id=\"text199780\" aria-hidden=\"true\" ><table style=\"border-collapse:collapse;top:0px;position:absolute; border-spacing:0; width:100%; height:100%\">\n<tr>\n<td style=\"position: absolute;top:0px;left:0px;box-sizing:border-box;width:100%;vertical-align:top;height:100%;padding:10px\">\n<div style=\'height:100%;width:100%;overflow-y:hidden;overflow-x:hidden;\'>\n\n<p  legLH=\"1.107\" style=\"margin-left:0px;text-indent:0px;line-height:1.107;margin-top:0px;margin-bottom:0px;text-align:left;\" >\n<span class=\"text199780Font1\"  >You now have the number of bird strikes and a trend, but how does that affect Flight Safety? To find out, you need to establish the Flight Safety Compromise Level. Searching first by using only the period, type of aircraft and the cause you will get a certain number of occurrences. In the next step, you will add the FSCL parameter with a value of LOW. If the number of occurrences returned by both searches are identical, this means that all occurrences were listed as having a low impact on the FSCL. You can therefore inform the CO that although there has been a rise in the number of bird strikes, the impact on flight safety remains low.\n</span ></p >\n\n\n</div></td>\n</tr>\n</table>\n</div>\n');
